import React from 'react';
import { makeStyles, withTheme } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid'
import Typography from '@material-ui/core/Typography';
import { Link } from '@material-ui/core';
import { emphasize } from "@material-ui/core/styles/colorManipulator";
import TextField from '@material-ui/core/TextField';

import NavbarSection from '../NavbarSection'

import ImgPattern from '../../assets/img/pattern2.png'
import ImgProducts1 from '../../assets/img/p1.png'
import ImgProducts2 from '../../assets/img/p2.png'
import ImgProducts3 from '../../assets/img/p3.png'
import ImgProducts4 from '../../assets/img/p4.png'
import ImgProducts5 from '../../assets/img/p5.png'
import ImgStar5 from '../../assets/img/star5.png'
import ImgStar4 from '../../assets/img/star4.png'
import ImgStar3 from '../../assets/img/star3.png'

export default function Contact() {
    const classes = useStyles();

    return (
        <div className={classes.firstDiv}>
            <Container>
                <NavbarSection theme='dark'/>
                <Grid container>
                    <form className={classes.root} noValidate autoComplete="off">
                        <Grid item xs={12} sm={12}>
                            <TextField
                                id="name"
                                label='Name'
                                placeholder="Write your message here..."
                                fullWidth
                                variant="outlined"
                            />
                        </Grid>
                        <Grid item xs={12} sm={12}>
                            <TextField
                                id="name"
                                label='Name'
                                placeholder="Write your message here..."
                                variant="outlined"
                            />
                        </Grid>
                        <Grid item xs={12} sm={12}>
                            <TextField
                                id="name"
                                label='Name'
                                placeholder="Write your message here..."
                                variant="outlined"
                            />
                        </Grid>
                        <Grid item xs={12} sm={12}>
                            <TextField
                                id="message"
                                label="Message"
                                multiline
                                rows="6"
                                placeholder="Write your message here..."
                                variant="outlined"
                            />
                        </Grid>
                    </form>
                </Grid>
            </Container>
        </div>
    )
}

const useStyles = makeStyles(theme => ({
    firstDiv: {
        backgroundImage: `url(${ImgPattern})`,
        backgroundSize: 'cover',
    },
    productImg: {
        width: '100%'
    },
    imgProducts: {
        width: '100%',
        marginBottom: '1rem'
    },
    imgStar: {
        width: '30%',
        display: 'block',
        marginLeft: 'auto',
        marginRight: 'auto',
        marginBottom: '1rem'
    },
    link: {
    }
}));

function ItemProduct(props) {
    const classes = useStyles();
    const Star = props.star;
    let StarImg;
    switch (props.star) {
        case '5':
            StarImg = ImgStar5
            break;
        case '4':
            StarImg = ImgStar4
            break;
        case '3':
            StarImg = ImgStar3
            break;
    }
    return (
        <div>
            <form className={classes.root} noValidate autoComplete="off">
                <TextField
                    id="outlined-multiline-static"
                    label="Multiline"
                    multiline
                    rows="6"
                    placeholder="Write your message here..."
                    variant="outlined"
                    color='white'
                />
            </form>
        </div>
    )
}
